import React from 'react'
import { Formik } from 'formik'
import { useNavigate } from 'react-router-dom'
import Swal from "sweetalert2"


const Pro_entry = () => {


    const navigate = useNavigate();

    const profile_submit = async (formdata, { resetForm }) => {
        console.log(formdata)
        resetForm()

        const res = await fetch('http://localhost:5000/company/add', {
            method: 'POST',
            body: JSON.stringify(formdata),
            headers: {
                'Content-Type': 'application/json'
            }
        });

        if (res.status === 200) {
            Swal.fire({
                icon: 'success',
                title: 'Success',
                text: 'Login Successful'
            })
        }
        else {
            Swal.fire({
                icon: 'error',
                title: 'Error',
                text: 'Something went wrong'
            })
        }







        return (
            <div>
                <div className="container">
                    <h1 className='text-center mt-5'>COMPANY PROFILE</h1>
                    <div className="row">

                        <div className="col-md-6">

                        </div>

                        <div className="col-md-6 mt-5">

                            <Formik initialValues={{ name: "", type: "", department: "", working: '', address: '', contact: '', email: '' }} onSubmit={profile_submit}>
                                {({ values, handleSubmit, handleChange }) => (
                                    <form onSubmit={handleSubmit}>
                                        <div className="">
                                            <label className="form-label text-dark" for="form12"><b>Company Name</b></label>
                                            <input type="text" id="form12" className="form-control mb-3" onChange={handleChange} value={values.name} />
                                        </div>
                                        <div className="">
                                            <label className="form-label text-dark" for="form12"><b>Company Type</b></label>
                                            <input type="text" id="form12" className="form-control mb-3" onChange={handleChange} value={values.type} />
                                        </div>
                                        <div className="">
                                            <label className="form-label text-dark" for="form12"><b>Name Of Departments</b></label>
                                            <input type="text" id="form12" className="form-control mb-3" onChange={handleChange} value={values.department} />
                                        </div>
                                        <div className="">
                                            <label className="form-label text-dark" for="form12"><b>Email</b></label>
                                            <input type="email" id="form12" className="form-control mb-3" onChange={handleChange} value={values.email} />
                                        </div>
                                        <div className="">
                                            <label className="form-label text-dark" htmlFor="typePhone">
                                                <b>Contact</b>
                                            </label>
                                            <input type="tel" id="typePhone" className="form-control mb-3" onChange={handleChange} value={values.contact} />
                                        </div>

                                        <div className="">
                                            <label className="form-label text-dark" htmlFor="textAreaExample"><b>Address</b>
                                            </label>
                                            <textarea
                                                className="form-control mb-3"
                                                id="textAreaExample"
                                                rows={4}
                                                defaultValue={""}
                                                onChange={handleChange}
                                                value={values.address}
                                            />

                                        </div>
                                        <div className="">
                                            <label className="form-label text-dark" htmlFor="textAreaExample"><b>Description of Company</b>
                                            </label>
                                            <textarea
                                                className="form-control  mb-3"
                                                id="textAreaExample"
                                                rows={4}
                                                defaultValue={""}
                                                onChange={handleChange}
                                                value={values.working}
                                            />

                                        </div>

                                    </form>
                                )}



                            </Formik>

                        </div>

                    </div>
                </div>
            </div>
        )
    }
}

    export default Pro_entry
